script: |
  super -f text -I q5026.spq | sort > q5026.out

inputs:
  - name: q5026.spq
    data: |
      SELECT DISTINCT col0 * 14 + + col1 - col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 + ( + col1 ) >= + - col0 + col0 + - col2;
  - name: tab2

outputs:
  - name: q5026.out
    data: |
